import React, { Component } from 'react';
import './colleges.css';
import Data from '../Data.json';

export default class Colleges extends Component {
	render() {
		let Colleges = Data.colleges;
		// console.log(Colleges, 'check the list of data');

		return (
			<>
				<div className='container'>
					<p>hello</p>
					{Colleges.map((val) => {
						<p>{val}</p>;
					})}
				</div>
			</>
		);
	}
}
